public ValueAxis getDomainAxis(int index) {
    ValueAxis result = this.domainAxes.get(index);
    if (result == null) {
        Plot parent = getParent();
        if (parent instanceof XYPlot) {
            XYPlot xy = (XYPlot) parent;
            result = xy.getDomainAxis(index);
        }
    }
    return result;
}

